import React from 'react'
import "./Home.css"


function Home() {
  return (
    <>
        <video id="video-bg" autoplay muted loop>
            <source src="/public/Videos\Vid.mp4" type="video/mp4"/>
        </video>
    </>
  )
}

export default Home
